    def enterOff(self, offset):
        pass

    def exitOff(self):
        pass

    def __cleanupNPCs(self):
        if self.chairman:
            self.chairman.hide()
            del self.chairman
        for cog in self.conveyorCogs:
            if cog:
                cog.cleanup()
                cog.removeNode()
                cog = None

        return

    def delete(self):
        self.demand('Off', 0.0)
        self.ignore('entercnode')
        if self.chairmanNote:
            self.chairmanNote.removeNode()
            self.chairmanNote.cleanup()
            del self.chairmanNote
        self.__cleanupNPCs()
        DistributedObject.delete(self)

    def enterIdle(self, offset):
        pass

    def exitIdle(self):
        pass

    def sendback(self):
        base.localAvatar.sendUpdate('resetEpisodeFlags')
        base.cr.inEpisode = False
        base.cr.currentEpisode = None
        base.cr._userLoggingOut = True
        if base.cr.timeManager:
            base.cr.timeManager.setDisconnectReason(ToontownGlobals.DisconnectBookExit)
        base.transitions.fadeScreen(1.0)
        base.cr.gameFSM.request('closeShard')
        return

