    def flyOutCogs(self):
        flyTrack = Parallel()
        flyOutSfx = base.loader.loadSfx('phase_5/audio/sfx/ENC_propeller_out.ogg')
        for cog in self.conveyorCogs:
            if cog != self.conveyorCogs[0]:
                flyTrack.append(Sequence(cog.beginSupaFlyMove(VBase3(cog.getX(), cog.getY(), cog.getZ()), 0, 'flyOut', sfx=False)))

        flyTrack.append(Func(flyOutSfx.play))
        flyTrack.start()

