    def moveCog(self, cog, moves, speed=0):
        cog.unstash()
        cogTrack = Sequence()
        x = 178
        if speed == 0:
            for m in range(moves):
                x -= 10.75
                cogTrack.append(cog.posInterval(2.0, (x, cog.getY(), cog.getZ())))
                cogTrack.append(Wait(1))

        else:
            if speed == 1:
                for m in range(moves):
                    x -= 15
                    cogTrack.append(cog.posInterval(2.0, (x, cog.getY(), cog.getZ())))

            else:
                if speed == 2:
                    for m in range(moves):
                        x -= 5
                        cogTrack.append(cog.posInterval(0.25, (x, cog.getY(), cog.getZ())))

        cogTrack.start()

    def moveConveyor(self, speed=0):
        moveTrack = Sequence()
        if speed == 0:
            for moves in range(4):
                moveTrack.append(Func(self.conveyorMovement))
                moveTrack.append(Wait(3.0))

        else:
            if speed == 1:
                self.conveyorMovement(1)
        moveTrack.start()

    def conveyorMovement(self, speed=0):
        lerper = NodePath('lerper')
        render.find('**/shelf_5').setTexProjector(TextureStage.getDefault(), NodePath(), lerper)
        if speed == 0:
            i = lerper.posInterval(2.0, VBase3(1, 0, 0))
        else:
            if speed == 1:
                i = lerper.posInterval(8.0, VBase3(5.5, 0, 0))
        i.start()

    def chairmanWake(self):
        self.chairmanWaken = Sequence()
        self.chairman.setPlayRate(0, 'neutral')
        self.chairman.loop('neutral')
        for x in xrange(0, 101):
            rate = x / 100.0
            self.chairmanWaken.append(Func(self.chairman.setPlayRate, rate, 'neutral'))
            self.chairmanWaken.append(Wait(0.01))

        for x in xrange(0, 101):
            alpha = x / 100.0
            self.chairmanWaken.append(Func(self.chairman.find('**/left_eye').setColorScale, 1, 1, 1, alpha))
            self.chairmanWaken.append(Func(self.chairman.find('**/right_eye').setColorScale, 1, 1, 1, alpha))
            self.chairmanWaken.append(Wait(0.01))

        self.chairmanWaken.start()

    def musicFade(self, song, fadeIn=False, fadeOut=False):
        songTrack = Sequence()
        if fadeIn:
            song.setVolume(0)
            song.play()
            vol = 0
            for v in xrange(0, 101):
                vol += 0.01
                songTrack.append(Sequence(Wait(0.02), Func(song.setVolume, vol)))

        else:
            if fadeOut:
                vol = song.getVolume()
                for v in xrange(0, 101):
                    if vol > 0.0:
                        vol -= 0.01
                        songTrack.append(Sequence(Wait(0.02), Func(song.setVolume, vol)))

                songTrack.append(Func(song.stop))
        songTrack.start()